import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faMapMarkerAlt, faClock } from '@fortawesome/free-solid-svg-icons';
import { faTwitter, faGoogle, faResearchgate } from '@fortawesome/free-brands-svg-icons';

const Contact = () => {
  return (
    <div>
      <h2>Contact</h2>

      <div className="contact-info">
        <h3><FontAwesomeIcon icon={faEnvelope} /> Email</h3>
        <p>zi.wang.prince@hotmail.com</p>

        <h3><FontAwesomeIcon icon={faMapMarkerAlt} /> Address</h3>
        <p>某大学社会科学学院政治学系</p>
        <p>中国 北京市 海淀区 某路100号</p>
        <p>邮编: 100000</p>

        <h3><FontAwesomeIcon icon={faEnvelope} /> 社交媒体</h3>
        <p>
          <a href="https://twitter.com/example" target="_blank" rel="noreferrer">
            <FontAwesomeIcon icon={faTwitter} /> Twitter
          </a> | 
          <a href="https://scholar.google.com/example" target="_blank" rel="noreferrer">
            <FontAwesomeIcon icon={faGoogle} /> Google Scholar
          </a> | 
          <a href="https://researchgate.net/example" target="_blank" rel="noreferrer">
            <FontAwesomeIcon icon={faResearchgate} /> ResearchGate
          </a>
        </p>

        <h3><FontAwesomeIcon icon={faClock} /> 办公时间</h3>
        <p>周一至周五: 上午10:00 - 下午4:00</p>
        <p>请提前通过邮件预约</p>
      </div>
    </div>
  );
};

export default Contact;
